import React from 'react';
import  './Project.css';
import img1 from './images/img1.jpg';
function Projects() {
  return (
    <div>
      <div className='project_items'>
        <div className='project_item1 item'>1
        </div>
        <div className='project_item2 item'>2</div>
        <div className='project_item3 item'>3</div>
        <div className='project_item4 item'>4</div>
        <div className='project_item5 item'>5</div>
        <div className='project_item6 item'>6</div>
      </div>
    </div>
  )
}

export default Projects
